import React from 'react';
import { NavLink } from 'react-router-dom';


const Card = (props) => {
    return(
    <>

                <div className=" col-md-3 col-10 mx-auto d-flex justify-content-between align-items-center flex-column">
                  <div className="card " >
                    <img src={props.imgsrc} className="card-img-top" alt={props.imgsrc} />
                    </div>
                      <div className="card-body">
                        <h5 className="card-title font-weight-bold">
                            {props.title}
                        </h5>
                        
                        {/* <NavLink to="" className="btn btn-primary">Watching video</NavLink> */}
                      </div>
                  
                  </div>
                
 
    </>
    )
}

export default Card;
